import { useRouteError } from "react-router-dom"
import './Errorpage.css';
import Cat from "./nyan-cat.gif"


const ErrorPage = () => {
    const error = useRouteError();

    console.error(error)

  return (
    <div>   
        <h1>Ops!</h1>
        <p>Deu erro</p>
        <p>{error.status.text}</p>
        <p>{error.mensage}</p>

    </div>
  )
}

export default ErrorPage
